    /***************************************************************************
     * 得到指定名称节点下的所有文本内容,包括节点(逆归)
     *
     * @param doc
     * xml文档对象
     * @param e
     * 要获取的节点对象
     * @param exceptTag
     * 要排除的节点名称
     * @return
     */
    public static String getChildAllText(Document doc, Element e) {
        if (e != null) {
            if (e.getChildren() != null) {
                List<Element> list = e.getChildren();
                xml += "";
                for (Element el : list) {
//                    System.out.println("el = " + el.getName());
                    List<Element> children = el.getChildren();
                    if (children.size() > 0) {
                        Gson gson = new Gson();
//                        System.out.println("el = " + gson.toJson(el));
                        for (Element child : children) {
                            List<Attribute> attributes = child.getAttributes();
                            attributes = attributes.parallelStream().filter(i -> i.getName().equalsIgnoreCase("X") ||
                                    i.getName().equalsIgnoreCase("Y")
                            ).collect(Collectors.toList());
                            System.out.println("elxyyyyy = " + gson.toJson(attributes));
                            String name = child.getName();
//                            System.out.println("name = " + name);
                        }
                        getChildAllText(doc, el);
                    } else {
                        xml += "" + el.getTextTrim() + ""
                                + el.getName() + ">";
                    }
                }
                xml += "" + e.getName() + ">";
            } else {
                xml += "" + e.getTextTrim() + ""
                        + e.getName() + ">";
            }
        }

        return xml;
    }

